var fileJSON=[{"path":"/glob/development-tools/versions/oneapi/2021.2/inteloneapi/dev-utilities/2021.2.0/include/dpc_common.hpp", "name":"dpc_common.hpp", "has_active_debug_locs":false, "absName":"/glob/development-tools/versions/oneapi/2021.2/inteloneapi/dev-utilities/2021.2.0/include/dpc_common.hpp", "content":"//==============================================================\012// Copyright © 2020 Intel Corporation\012//\012// SPDX-License-Identifier: MIT\012// =============================================================\012\012#ifndef _DP_HPP\012#define _DP_HPP\012\012#pragma once\012\012#include <stdlib.h>\012#include <exception>\012\012#include <CL/sycl.hpp>\012\012namespace dpc_common {\012// this exception handler with catch async exceptions\012static auto exception_handler = [](cl::sycl::exception_list eList) {\012  for (std::exception_ptr const &e : eList) {\012    try {\012      std::rethrow_exception(e);\012    } catch (std::exception const &e) {\012#if _DEBUG\012      std::cout << \"Failure\" << std::endl;\012#endif\012      std::terminate();\012    }\012  }\012};\012\012// The TimeInterval is a simple RAII class.\012// Construct the timer at the point you want to start timing.\012// Use the Elapsed() method to return time since construction.\012\012class TimeInterval {\012 public:\012  TimeInterval() : start_(std::chrono::steady_clock::now()) {}\012\012  double Elapsed() {\012    auto now = std::chrono::steady_clock::now();\012    return std::chrono::duration_cast<Duration>(now - start_).count();\012  }\012\012 private:\012  using Duration = std::chrono::duration<double>;\012  std::chrono::steady_clock::time_point start_;\012};\012\012};  // namespace dpc_common\012\012#endif\012"}, {"path":"/home/u75983/dpcpp-tutorial/matrix-multi/build/src/matrix-multi-st-v2.cpp", "name":"matrix-multi-st-v2.cpp", "has_active_debug_locs":false, "absName":"/home/u75983/dpcpp-tutorial/matrix-multi/build/src/matrix-multi-st-v2.cpp", "content":"//==============================================================\012// DPC++ Example\012//\012// Matrix Multiplication with DPC++\012//\012// Author: Yan Luo\012//\012// Copyright ©  2020-\012//\012// MIT License\012//\012#include <CL/sycl.hpp>\012#include <array>\012#include <iostream>\012#include \"dpc_common.hpp\"\012#if FPGA || FPGA_EMULATOR || FPGA_PROFILE\012#include <CL/sycl/INTEL/fpga_extensions.hpp>\012#endif\012\012using namespace sycl;\012\012// matrice shapes for this example.\012// A: a_rows x a_columns\012// B: a_columns x b_columns\012// C,Sum: a_rows x b_columns\012constexpr size_t a_rows = 800;\012constexpr size_t a_columns = 1600;\012constexpr size_t b_columns = 3200;\012\012class MMstv2;\012\012void MatrixMulti_st_v2(queue &q, float (*matrix_a)[a_columns], float (*matrix_b)[b_columns], \012  float (*matrix_c)[b_columns], float (*matrix_d_parallel)[b_columns]) {\012\012  std::cout << \"MatrixMultiplication using single_task() v2.\" << std::endl;\012\012  // Create the range object for the arrays managed by the buffer.\012  range<2> num_items{a_rows, b_columns};\012  size_t widthA = a_columns;\012  size_t widthB = b_columns;\012  size_t widthC = b_columns;\012\012  // Create buffers that hold the data shared between the host and the devices.\012  // The buffer destructor is responsible to copy the data back to host when it\012  // goes out of scope.\012  buffer<float, 2> a_buf(reinterpret_cast<float *>(matrix_a), range(a_rows, a_columns));\012  buffer<float, 2> b_buf(reinterpret_cast<float *>(matrix_b), range(a_columns, b_columns));\012  buffer<float, 2> c_buf(reinterpret_cast<float *>(matrix_c), num_items);\012  buffer<float, 2> sum_buf(reinterpret_cast<float *>(matrix_d_parallel), num_items);\012\012  // Submit a command group to the queue by a lambda function that contains the\012  // data access permission and device computation (kernel).\012  event e = q.submit([&](handler &h) {\012    // Create an accessor for each buffer with access permission: read, write or\012    // read/write. The accessor is a mean to access the memory in the buffer.\012    auto a = a_buf.get_access<access::mode::read, access::target::global_buffer>(h);\012    auto b = b_buf.get_access<access::mode::read, access::target::global_buffer>(h);\012    auto c = c_buf.get_access<access::mode::read, access::target::global_buffer>(h);\012\012    // The sum_accessor is used to store (with write permission) the sum data.\012    auto sum = sum_buf.get_access<access::mode::write>(h);\012  \012    // Use single_task to run vector addition in parallel on device. This\012    // executes the kernel.\012    // A kernel that is executed on one thread using NDRange(1,1,1) is enqueued \012    // using the cl::sycl::single_task API:\012    //   single_task<typename kernel_lambda_name>([=](){});\012    h.single_task<MMstv2>([=]() [[intel::kernel_args_restrict]]\012      { \012        #pragma unroll 4\012        for (size_t i = 0; i < a_rows * b_columns; i++) {\012          size_t row, col, s;\012          row = i / widthC;\012          col = i % widthC;          \012          \012          s = 0;\012          #pragma unroll 2\012          for (size_t k = 0; k < a_columns; k++)\012            s += a[row][k] * b[k][col]; \012          sum[row][col]  = c[row][col] + s;\012        }\012      });\012  });\012\012#if FPGA || FPGA_PROFILE\012  // Query event e for kernel profiling information\012  // (blocks until command groups associated with e complete)\012  double kernel_time_ns =\012    e.get_profiling_info<info::event_profiling::command_end>() -\012    e.get_profiling_info<info::event_profiling::command_start>();\012\012  // Report profiling info\012  std::cout << \"Kernel compute time:  \" << kernel_time_ns * 1e-6 << \" ms\\n\";\012#endif\012}\012\012\012//************************************\012// Demonstrate matrix multiplication both in sequential on CPU and in parallel on device.\012//************************************\012int main() {\012  // Create device selector for the device of your interest.\012#if FPGA_EMULATOR\012  // DPC++ extension: FPGA emulator selector on systems without FPGA card.\012  INTEL::fpga_emulator_selector d_selector;\012#elif defined(FPGA) || defined(FPGA_PROFILE)\012  // DPC++ extension: FPGA selector on systems with FPGA card.\012  INTEL::fpga_selector d_selector;\012#else\012  // The default device selector will select the most performant device.\012  default_selector d_selector;\012  //cpu_selector d_selector;\012#endif\012\012  // Query about the platform\012  //\012  unsigned number = 0;\012  auto myPlatforms = platform::get_platforms();\012  // loop through the platforms to poke into\012  for (auto &onePlatform : myPlatforms) {\012    std::cout << ++number << \" found ..\" << std::endl << \"Platform: \" \012    << onePlatform.get_info<info::platform::name>() <<std::endl;\012    // loop through the devices\012    auto myDevices = onePlatform.get_devices();\012    for (auto &oneDevice : myDevices) {\012      std::cout << \"Device: \" \012      << oneDevice.get_info<info::device::name>() <<std::endl;\012    }\012  }\012  std::cout << std::endl;\012\012  // Create matrices with row, column and initial value \012  // to store the input and output data.\012  float(*A)[a_columns] = new float[a_rows][a_columns];\012  // Intialize values\012  for (int i = 0; i < a_rows; i++)\012    for (int j = 0; j < a_columns; j++) A[i][j] = 1.0;\012\012  float(*B)[b_columns] = new float[a_columns][b_columns];\012  // Intialize values\012  for (int i = 0; i < a_columns; i++)\012    for (int j = 0; j < b_columns; j++) B[i][j] = 2.0;\012\012  float(*C)[b_columns] = new float[a_rows][b_columns];\012  // Intialize values\012  for (int i = 0; i < a_rows; i++)\012    for (int j = 0; j < b_columns; j++) C[i][j] = 3.0;\012\012  float(*sum_sequential)[b_columns] = new float[a_rows][b_columns];\012  float(*sum_stv2)[b_columns] = new float[a_rows][b_columns];\012  // Intialize values\012  for (int i = 0; i < a_rows; i++)\012    for (int j = 0; j < b_columns; j++) {\012      sum_sequential[i][j] = 0.0;\012      sum_stv2[i][j] = 0.0;\012    }\012\012#ifndef FPGA_PROFILE\012  // Start the timer (using std::chrono)\012  dpc_common::TimeInterval exec_time;    \012\012  // Compute the sum of two arrays in sequential for validation.\012  std::cout << \"computing on host...\" << std::endl;\012  for (size_t i = 0; i < a_rows; i++)\012    for (size_t j = 0; j < b_columns; j++) {\012      sum_sequential[i][j] = C[i][j];\012      for (size_t k = 0; k < a_columns; k++)\012        sum_sequential[i][j] += A[i][k] * B[k][j];\012    }\012\012  double host_time_s = exec_time.Elapsed();\012  std::cout << \"host compute time \" << host_time_s * 1000 << \" ms\\n\";\012#endif\012\012  try {\012    queue q(d_selector, dpc_common::exception_handler, \012		    property::queue::enable_profiling{});\012\012    // Print out the device information used for the kernel code.\012    std::cout << \"Running on device: \"\012              << q.get_device().get_info<info::device::name>() << \"\\n\";\012    std::cout << \"Matrix A size: \" << a_rows << \",\" << a_columns << std::endl;\012    std::cout << \"Matrix B size: \" << a_columns << \",\" << b_columns << std::endl;\012    std::cout << \"Matrices C, D size: \" << a_rows << \",\" \012              << b_columns << std::endl;\012\012    // Matrix multiplication in DPC++\012    MatrixMulti_st_v2(q, A, B, C, sum_stv2);\012\012#ifndef FPGA_PROFILE\012    // Verify that the two arrays are equal.\012    for (size_t i = 0; i < a_rows; i++)\012      for (size_t j = 0; j < b_columns; j++) \012        if( (sum_sequential[i][j] - sum_stv2[i][j]) > 0.0001) {\012          std::cout << \"not equal\" << std::endl;\012          return -1;\012        }\012    std::cout << \"Matrix multiplication successfully completed on device.\\n\";\012#endif\012\012  } catch (exception const &e) {\012    std::cout << \"An exception is caught for matrix multiplication.\\n\";\012    std::terminate();\012  }\012\012  return 0;\012}\012"}];
